import React, { Component } from 'react';
import Modal from 'react-awesome-modal';
import 'photoswipe/dist/photoswipe.css'
import 'photoswipe/dist/default-skin/default-skin.css'

import { Gallery, Item } from 'react-photoswipe-gallery'
export default class Gallery1 extends Component {
  render() {
    return (
        <React.Fragment>

  <Gallery>
    <Item
      original="https://i.ibb.co/zrMcVf1/mountain-thumb.jpg"
      thumbnail="https://i.ibb.co/zrMcVf1/mountain-thumb.jpg"
      width="300"
      height="468"
    >
      {({ ref, open }) => (
        <img ref={ref} onClick={open} src="https://i.ibb.co/zrMcVf1/mountain-thumb.jpg" />
      )}
    </Item>

    <Item
      original="https://placekitten.com/1024/76 8?image=2"
      thumbnail="https://placekitten.com/80/60?image=2"
      width="1024"
      height="768"
    >
      {({ ref, open }) => (
        <img ref={ref} onClick={open} src="https://placekitten.com/80/60?image=2" />
      )}
    </Item>
  </Gallery>


    </React.Fragment>
      );
    }
  }
